def solve(n: int) -> int:
    # Compute the sum of the fourteenth powers of the first n even numbers
    sum_of_powers = n*(n+1)*(2*n+1)*(3*n**2 + 3*n - 1)*((2**14)/30)

    # Convert sum_of_powers to a string and sum the even digits
    str_sum = str(int(sum_of_powers))  # convert to integer to remove any decimal places
    return sum(int(d) for d in str_sum if int(d) % 2 == 0)
